import React, { Component } from 'react';
import MainLayout from "../components/layouts/mainLayout";

class Home extends Component {
  render() {
    return (
      <>
        <MainLayout>
          <h1 className={css.wrapper}>Welcome to NextJS</h1>
        </MainLayout>
      </>
    );
  }
}

export default Home;
